import React, { Component } from "react";

export default class CelsiusIndicator extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <>
        <p>Temperature (Celsius):</p>
        <input type="number" value={this.state.temperature}></input>
      </>
    );
  }
}
